import React from 'react';
import { Card, Col } from 'react-bootstrap';
import { IProduct } from '../store/ProductStore';

const ProductItem = (product: IProduct) => {
    return (
        <Col md={4}>
            <Card className='m-3 p-3'>
                <img src='' />
                {product.name}
            </Card>
        </Col>
    );
};

export default ProductItem;
